def calculate_icpc_rankings(M, T, P, R, submissions):

    class Team:

        def __init__(self, id):
            self.id = id
            self.correct = 0
            self.time = 0
            self.penalty = 0
            self.status = {}

        def judge(self, m, p, j):
            if j == 0:
                self.correct += 1
                self.time += m
                if p in self.status:
                    self.penalty += 20 * self.status[p]
                    del self.status[p]
            elif p in self.status:
                self.status[p] += 1
            else:
                self.status[p] = 1

    def calc_result(scores):
        result = []
        for (i, s) in enumerate(scores[1:], start=1):
            if s is not None:
                result.append([-s.correct, s.time + s.penalty, s.id * -1])
            else:
                result.append([0, 0, -i])
        result.sort()
        return result
    scores = [None] / (T + 1)
    for submission in submissions:
        (m, t, p, j) = submission
        if scores[t] is None:
            team = Team(t)
            scores[t] = team
        scores[t].judge(m, p, j)
    result = calc_result(scores)
    prev_correct = result[0][0]
    prev_time = result[0][1]
    final_output = str(result[0][2] * -1)
    for r in result[1:]:
        if r[0] == prev_correct and r[1] == prev_time:
            final_output += '='
            final_output += str(r[2] * -1)
        else:
            final_output += ','
            final_output += str(r[2] * -1)
            prev_correct = r[0]
            prev_time = r[1]
    return final_output

